	(1,'Office Campaign','US/Central','epxhyper','{\"INTRODUCTION\":{\"TITLE\":\"Introduction\",\"SCRIPT\":\"Hello {{FIRSTNAME}}, how are you doing today?\"},\"REASON\":{\"TITLE\":\"Reason for Calling\",\"SCRIPT\":\"I am calling on behalf of your doctor. We have a service we can offer you to better manage your health.\"},\"CONFIRM_DOB\":{\"TITLE\":\"Confirm Date of Birth\",\"SCRIPT\":\"Could you please confirm your date of birth for me? It should be {{DOB}}.\"},\"ENROLLMENT\":{\"TITLE\":\"Enrollment\",\"INPUTS\":[{\"title\":\"Do you prefer text message or phone calls?\",\"type\":\"select\",\"name\":\"method\",\"options\":[{\"label\":\"Text Message\",\"value\":\"message\"},{\"label\":\"Phone Call\",\"value\":\"call\"}]},{\"title\":\"What time of the day would you like?\",\"type\":\"time\",\"name\":\"time\"},{\"title\":\"What days of the week would you like?\",\"type\":\"select\",\"name\":\"days\",\"options\":[{\"label\":\"Monday, Wednesday, Friday\",\"value\":[1,3,5]},{\"label\":\"Tuesday, Thursday\",\"value\":[2,4]}]},{\"title\":\"What timezone are you in?\",\"type\":\"timezone\",\"name\":\"tz\"}]}}',1,'2018-09-04 15:00:51',0,NULL,1,1,1,NULL,'2018-09-04 14:56:53','2018-09-04 15:00:51',NULL),
	(2,'Mohawk Hypertension','US/Eastern','epxhyper','{\"INTRODUCTION\":{\"TITLE\":\"Introduction\",\"SCRIPT\":\"Hello {{FIRSTNAME}}, how are you doing today?\"},\"REASON\":{\"TITLE\":\"Reason for Calling\",\"SCRIPT\":\"I am calling on behalf of the Healthy Life Team. We have a service we can offer you to better manage your health.\"},\"CONFIRM_DOB\":{\"TITLE\":\"Confirm Date of Birth\",\"SCRIPT\":\"Could you please confirm your date of birth for me?\"},\"ENROLLMENT\":{\"TITLE\":\"Enrollment\",\"INPUTS\":[{\"title\":\"Do you prefer text message or phone calls?\",\"type\":\"select\",\"name\":\"method\",\"options\":[{\"label\":\"Text Message\",\"value\":\"message\"},{\"label\":\"Phone Call\",\"value\":\"call\"}]},{\"title\":\"What time of the day would you like?\",\"type\":\"time\",\"name\":\"time\"},{\"title\":\"What days of the week would you like?\",\"type\":\"select\",\"name\":\"days\",\"options\":[{\"label\":\"Monday, Wednesday, Friday\",\"value\":[1,3,5]},{\"label\":\"Tuesday, Thursday\",\"value\":[2,4]}]},{\"title\":\"What timezone are you in?\",\"type\":\"timezone\",\"name\":\"tz\"},{\"title\":\"Do you need a blood pressure cuff?\",\"type\":\"select\",\"name\":\"needCuff\",\"options\":[{\"label\":\"Yes\",\"value\":true},{\"label\":\"No\",\"value\":false}]}]}}',1,'2018-09-04 18:40:57',0,NULL,2,1,1,NULL,'2018-09-04 18:28:52','2018-09-27 23:32:08',NULL),
	(3,'Unresponsive MHK HTN','US/Central','epxhyper','{\"INTRODUCTION\":{\"TITLE\":\"Introduction\",\"SCRIPT\":\"Hello {{FIRSTNAME}}, how are you doing today?\"},\"REASON\":{\"TITLE\":\"Reason for Calling\",\"SCRIPT\":\"I am calling on behalf of Doctor Who. We have a service we can offer you to better manage your health.\"},\"CONFIRM_DOB\":{\"TITLE\":\"Confirm Date of Birth\",\"SCRIPT\":\"Could you please confirm your date of birth for me?\"},\"ENROLLMENT\":{\"TITLE\":\"Enrollment\",\"INPUTS\":[{\"title\":\"Do you prefer text message or phone calls?\",\"type\":\"select\",\"name\":\"method\",\"options\":[{\"label\":\"Text Message\",\"value\":\"message\"},{\"label\":\"Phone Call\",\"value\":\"call\"}]},{\"title\":\"What time of the day would you like?\",\"type\":\"time\",\"name\":\"time\"},{\"title\":\"What days of the week would you like?\",\"type\":\"select\",\"name\":\"days\",\"options\":[{\"label\":\"Monday, Wednesday, Friday\",\"value\":[1,3,5]},{\"label\":\"Tuesday, Thursday\",\"value\":[2,4]}]},{\"title\":\"What timezone are you in?\",\"type\":\"timezone\",\"name\":\"tz\"}]}}',0,NULL,0,NULL,3,1,NULL,NULL,'2018-09-19 18:11:20','2018-09-19 18:11:20',NULL),
	(4,'VPS CPC Hypertension','US/Central','epxhyper','{\"INTRODUCTION\":{\"TITLE\":\"Introduction\",\"SCRIPT\":\"Good morning/afternoon, my name is XXX and I am calling on behalf of your employer, CPC Logistics on a recorded line. May I please speak with {{FULLNAME}}?\"},\"REASON\":{\"TITLE\":\"Reason for Calling\",\"SCRIPT\":\"Thanks, {{FIRSTNAME}}. I am calling today to let you know that your employer CPC is offering a free Medication Therapy Management program provided by VPS. This offers free one on one review on how to lower your medical spending this year, as well as make sure you can keep your blood pressures healthy for any upcoming Department of Transportation Medical Card reviews. CPC will never see or review your health information, just your pharmacist. Is that something I can get started free of charge for you?\"},\"CONFIRM_DOB\":{\"TITLE\":\"Confirm Date of Birth\",\"SCRIPT\":\"Could you please confirm your date of birth for me?\\n\\n**It should be {{DOB}}.**\"},\"ENROLLMENT\":{\"TITLE\":\"Enrollment\",\"INPUTS\":[{\"title\":\"Do you prefer text message or phone calls?\",\"type\":\"select\",\"name\":\"method\",\"options\":[{\"label\":\"Text Message\",\"value\":\"message\"},{\"label\":\"Phone Call\",\"value\":\"call\"}]},{\"title\":\"What time of the day would you like?\",\"type\":\"time\",\"name\":\"time\"},{\"title\":\"What days of the week would you like?\",\"type\":\"select\",\"name\":\"days\",\"options\":[{\"label\":\"Monday, Wednesday, Friday\",\"value\":[1,3,5]},{\"label\":\"Tuesday, Thursday\",\"value\":[2,4]}]},{\"title\":\"What timezone are you in?\",\"type\":\"timezone\",\"name\":\"tz\"}]}}',1,'2018-09-24 20:10:04',0,NULL,4,1,5,NULL,'2018-09-21 14:28:55','2018-09-24 20:10:04',NULL);
